import React, {Component} from 'react'
import './mobile.css';

class mobile extends Component {
    constructor(props)
    {
        super(props);
        this.name = "samsung";
    }


    render()
    {
        return <h1>{this.props.name}</h1>
    }
} 

export default mobile;
